      body: "Aktienmärkte weiterhin im Konsolidierungsmodus Im September zeigten sich die Aktienmärkte von ihrer schwankungsreichen Seite. Während die Schweizer Indizes leichte Kursgewinne verzeichneten verloren die übrigen Aktienmärkte mehrheitlich an Terrain. Wir nehmen keine Veränderungen an unserer Sektoreneinstufung vor. Anfang September kam es vor allem bei den zuvor stark angestiegenen Technologiewerten zu Gewinnmitnahmen. Der technologielastige Nasdaq notierte zwischenzeitlich rund 10% unterden Rekordniveaus vom August. Im Monatsverlauf konnten diese Abgaben aber teilweise wieder aufgeholt werden. Letztlich gab der Nasdaq im September knapp 6% nach. Generell fiel die Monatsbilanz bei den meisten Aktienmärkten negativ aus. Die Schweizer Indizes SMI und SPI konnten dagegen leichte Kursgewinne von je 0.5% ausweisen. Die Aktienmärkte setzten damit ihre Konsolidierung seit Ende Juni fort. Die Hoffnungen auf einen raschen wirtschaftlichen Aufschwung nach den Lockerungsmassnahmen und auf einen Impfstoff gegen das Coronavirushielten sich mit den wieder ansteigenden Corona-Infektionen und den damit verbundenen Unsicherheiten die Waage. Neue Impulse für die Aktienmärkte wird die anlaufende Berichtssaison zum 3. Quartal liefern welche einen Überblick über die aktuellen Unternehmensentwicklungen und die Aussichten ermöglicht. Optimistischer dennoch negatives Gewinnwachstum Die US-Analysten zeigen sich optimistischer fürs 3 Quartal als noch zum Ende des 2. Quartals zumal auch einige Unternehmenihre Ausblicke erhöhten. Inzwischen rechnen die Analysten noch mit einem Gewinnrückgang bei den S&P500 Unternehmen von 21%. Die stärksten Gewinnrückgänge werden in den Sektoren Energie Industrie und zyklischer Konsum erwartet. Der starke Ölpreisrückgang im Vergleich zum Vorjahr belastet dabei hauptsächlich den Energiesektor. Auf dem Industriesektor lasten vor allem die schwächelnden Airline-Unternehmen welche von den Reiserestriktionen besonders hart getroffen wurden. Auch dieTourismusbranche und der Restaurant- und Freizeitbereich wurden durch die Lockdown-Massnahmen stark beeinträchtigt. Krisenbedingt wurden weniger Autos nachgefragt was die Automobilbranche negativ beeinflusste. Dies führte insgesamt zum Gewinnrückgang bei vielen Unternehmen aus dem Bereich zyklischen Konsum. Zwar ist ein grosser Teil von Amazon abhängig jedoch ist dort die stark schwankende Gewinnentwicklung schwer zu prognostizieren. Fürs 4. Quartal rechnen die Analysten bei den S&P500 Unternehmen mit einer leichten Verbesserung und mit einem Gewinnrückgang von 12.7%. 2021 erwarten die Analysten wieder ein positives Gewinnwachstum.Schwache Performance im September Im September zeigte sich insgesamt ein eher defensives Sektorenbild. Dabei verloren alle Sektoren an Wert. Relativ am stärksten entwickelten sich die Sektoren Versorger Gesundheit und nichtzyklischer Konsum. Die Sektoren Energie Technologie und Kommunikationsdienste schnitten hingegen unterdurchschnittlich ab. Das Momentum nahm in allen Sektor",
